import React, { Component } from 'react'

import { withRouter, Link } from "react-router-dom";
import GoogleMapReact from 'google-map-react';

import SignUp from '../components/SignUp'
import LogIn from '../components/LogIn'

import NavBar from '../components/NavBar'
import Footer from '../components/Footer'

const AnyReactComponent = ({ text }) => <div>{text}</div>;

class Dashboard extends Component {

    constructor(props){
        super(props);

        this.state = {
            userLoggedIn: props,
            userInfo: props.user,
        }
    }

    logInUser = (user) => {
        this.props.logInUser(user)
    }

    logOutUser = () => {
        this.props.logOutUser()
    }

    goToProfile = () => {
        this.props.history.push('/user/' + this.props.user.name)
    }

    signUpUser = (user) => {
        this.props.signUpUser(user)
    }

    goToRestaurantProfile = () => {
        this.props.history.push('/restaurant/' + 'asd')

    }


    static defaultProps = {
        center: {
            lat: -37.798404,
            lng: 144.963211
        },
        zoom: 13
    };

    render() {
        console.log('dashboard props', this.props)

        return (
            <div >

                <NavBar
                    {...this.props}
                    logOutUser={this.logOutUser}
                    logInUser={this.logInUser}
                    signUpUser={this.signUpUser}
                    userLoggedIn={this.props.userLoggedIn}
                    goToProfile={this.goToProfile}
                />

                <div className='home-grid-container'>

                    <div className='home-grid-main'>
                        <h1>Discover. Earn credits. Get rewards.</h1>
                        <h4>Support your local sustainable eateries.</h4>
                        <input
                            placeholder='Search eatery by name'
                            className='home-grid-form-input'
                        />
                        <Link to='/restaurants'>View Complete List</Link>
                    </div>

                    <div className='home-grid-discover-button'>
                        Discover Eateries
                    </div>


                    <div className='home-grid-map'>
                        <GoogleMapReact
                            bootstrapURLKeys={{ key: 'AIzaSyAThroloBz4lBlrWA_ZCmtXfOFdsI46CXY' }}
                            defaultCenter={this.props.center}
                            defaultZoom={this.props.zoom}
                        >
                            <AnyReactComponent
                                lat={59.955413}
                                lng={30.337844}
                                text="My Marker"
                            />
                        </GoogleMapReact>
                    </div>

                    <div className='home-grid-featured-title'>
                        Featured Cafes
                    </div>

                    <div className='home-grid-featured'>
                        <div
                            className='home-grid-featured-item'
                            onClick={this.goToRestaurantProfile}
                        >

                        </div>
                        <div className='home-grid-featured-item'>

                        </div>
                        <div className='home-grid-featured-item'>

                        </div>
                    </div>

                    <div className='home-grid-top-button'>
                        Back To Top
                    </div>


                </div>

                <Footer />
            </div>
        );
    }
}

export default withRouter(Dashboard);
